      <path
        id="Path_768"
        data-name="Path 768"
        d="M8.514,20h-4a2,2,0,0,1-2-2V6a2,2,0,0,1,2-2h4V6h-4V18h4Z"
        transform="translate(-2.514 -4)"
      />
      <path
        id="Path_769"
        data-name="Path 769"
        d="M13.842,17.385l1.42-1.408-3.919-3.953h9.143a1,1,0,0,0,0-2H11.324L15.3,6.077,13.9,4.657,7.5,10.994Z"
        transform="translate(-2.514 -4)"
      />
    </svg>
  );
};

export default LogOut;
